import React from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Button,
  Box,
  Chip,
} from '@mui/material';
import { styled } from '@mui/material/styles';
import DownloadIcon from '@mui/icons-material/Download';
import MovieIcon from '@mui/icons-material/Movie';
import AudiotrackIcon from '@mui/icons-material/Audiotrack';
import HighQualityIcon from '@mui/icons-material/HighQuality';

const GlassTableContainer = styled(TableContainer)({
  background: 'rgba(26, 9, 56, 0.6)',
  backdropFilter: 'blur(10px)',
  borderRadius: '15px',
  border: '1px solid rgba(255, 82, 202, 0.1)',
  boxShadow: '0 8px 32px rgba(255, 82, 202, 0.15)',
  overflow: 'hidden',
  marginTop: '2rem',
  transition: 'transform 0.3s ease, box-shadow 0.3s ease',
  '&:hover': {
    transform: 'translateY(-5px)',
    boxShadow: '0 12px 40px rgba(255, 82, 202, 0.25)',
  },
});

const StyledTable = styled(Table)({
  '& .MuiTableCell-root': {
    borderColor: 'rgba(255, 82, 202, 0.1)',
    color: 'white',
    padding: '1rem',
  },
  '& .MuiTableHead-root .MuiTableCell-root': {
    fontWeight: 'bold',
    background: 'rgba(255, 82, 202, 0.1)',
  },
  '& .MuiTableRow-root': {
    transition: 'background-color 0.3s ease',
    '&:hover': {
      backgroundColor: 'rgba(255, 82, 202, 0.05)',
    },
  },
});

const DownloadButton = styled(Button)({
  background: 'linear-gradient(45deg, #FF52CA 30%, #9B4DFF 90%)',
  border: 0,
  borderRadius: '25px',
  boxShadow: '0 3px 5px 2px rgba(255, 82, 202, 0.3)',
  color: 'white',
  padding: '8px 24px',
  transition: 'all 0.3s ease',
  '&:hover': {
    background: 'linear-gradient(45deg, #FF52CA 50%, #9B4DFF 100%)',
    transform: 'scale(1.05)',
    boxShadow: '0 5px 15px 2px rgba(255, 82, 202, 0.4)',
  },
});

const QualityChip = styled(Chip)({
  background: 'rgba(255, 82, 202, 0.1)',
  color: 'white',
  border: '1px solid rgba(255, 82, 202, 0.2)',
  '& .MuiSvgIcon-root': {
    color: '#FF52CA',
  },
  '&:hover': {
    background: 'rgba(255, 82, 202, 0.2)',
  },
});

const DownloadOptions = ({ formats, onDownload }) => {
  if (!formats || formats.length === 0) return null;

  // Filter out invalid formats and ensure required properties exist
  const validFormats = formats.filter(format => 
    format && 
    typeof format === 'object' &&
    (format.formatId || format.itag) // Check for either formatId or itag
  );

  return (
    <GlassTableContainer>
      <StyledTable>
        <TableHead>
          <TableRow>
            <TableCell>الجودة</TableCell>
            <TableCell>النوع</TableCell>
            <TableCell>حجم الملف</TableCell>
            <TableCell>الصوت</TableCell>
            <TableCell>التحميل</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {validFormats.map((format, index) => (
            <TableRow key={format.formatId || format.itag || `format-${index}`}>
              <TableCell>
                <QualityChip
                  icon={<HighQualityIcon />}
                  label={format.qualityLabel || 'صوت فقط'}
                />
              </TableCell>
              <TableCell>
                <QualityChip
                  icon={format.hasVideo ? <MovieIcon /> : <AudiotrackIcon />}
                  label={((format.container || format.mimeType || 'MP4') + '').toUpperCase()}
                />
              </TableCell>
              <TableCell>
                {format.contentLength ? 
                  `${(parseInt(format.contentLength) / 1024 / 1024).toFixed(1)} MB` : 
                  'غير معروف'
                }
              </TableCell>
              <TableCell>
                <QualityChip
                  label={format.hasAudio ? 'متوفر' : 'غير متوفر'}
                  color={format.hasAudio ? 'success' : 'error'}
                />
              </TableCell>
              <TableCell>
                <DownloadButton
                  variant="contained"
                  startIcon={<DownloadIcon />}
                  onClick={() => onDownload(format)}
                >
                  تحميل
                </DownloadButton>
              </TableCell>
            </TableRow>
          ))}
        </TableBody>
      </StyledTable>
    </GlassTableContainer>
  );
};

export default DownloadOptions;
